import "./App.css";
import InstrumentList from "./instrumentList";

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<InstrumentList />} />
      </Routes>
    </div>
  );
}

export default App;
